import React, { Component } from 'react';

const default_border_style = "border border-3 <border-width-300></border-width-300> rounded border-"

class ComputationForm extends Component {
    state = { 
        style_color : "success"
    } 

    render() { 
        return (
            
            <React.Fragment>
                <span className={default_border_style + this.props.currentStyle}>
                    ** FORM **
                </span>
            </React.Fragment>
        );
    }
}
 
export default ComputationForm;
